import React, { useState } from "react";
import { createClient } from "@supabase/supabase-js";
import { motion } from "framer-motion";

// Replace with your Supabase keys
const supabaseUrl = "https://wkoprjwroyuroxtjrqpq.supabase.co";
const supabaseKey = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6Indrb3Byandyb3l1cm94dGpycXBxIiwicm9sZSI6ImFub24iLCJpYXQiOjE3NTEzNTc1NzMsImV4cCI6MjA2NjkzMzU3M30.lgydOt5EvRseJMoYgMlOZGI8-n0ugkXcAjRrlLJ2mSE";
const supabase = createClient(supabaseUrl, supabaseKey);


function App() {
  const [formData, setFormData] = useState({
    full_name: "",
    phone_number: "",
    dob: "",
    qualification: "",
    permanent_address: "",
    current_address: "",
  });
  const [loading, setLoading] = useState(false);
  const [showModal, setShowModal] = useState(false);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    if (type === "checkbox") {
      setFormData((prev) => ({
        ...prev,
        current_address: checked ? prev.permanent_address : "",
      }));
    } else {
      setFormData((prev) => ({ ...prev, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    const { error } = await supabase.from("personal_details").insert([formData]);
    setLoading(false);
    if (!error) {
      setShowModal(true);
      setFormData({
        full_name: "",
        phone_number: "",
        dob: "",
        qualification: "",
        permanent_address: "",
        current_address: "",
      });
      setTimeout(() => setShowModal(false), 2500); // auto-close after 2.5 sec
    } else {
      alert("Submission failed. Please try again.");
    }
  };

  return (
    <div className="flex items-center justify-center min-h-screen p-4 bg-gradient-to-br from-blue-50 to-purple-50">
      <div className="bg-white p-8 rounded-2xl shadow-xl max-w-md w-full relative">
        <h1 className="text-3xl font-bold text-center text-purple-600 mb-2">
          Registration For ITI Apprenticeship In Nagpur
        </h1>
        <p className="text-center text-gray-500 mb-6">
          Fill out the form to submit your details.
        </p>
        <form onSubmit={handleSubmit} className="space-y-4">
          <input
            type="text"
            name="full_name"
            placeholder="Full Name"
            required
            value={formData.full_name}
            onChange={handleChange}
            className="border p-3 rounded w-full focus:outline-none focus:ring-2 focus:ring-purple-400"
          />
          <input
            type="text"
            name="phone_number"
            placeholder="Phone Number"
            required
            value={formData.phone_number}
            onChange={handleChange}
            className="border p-3 rounded w-full focus:outline-none focus:ring-2 focus:ring-purple-400"
          />
          <input
            type="date"
            name="dob"
            required
            value={formData.dob}
            onChange={handleChange}
            className="border p-3 rounded w-full focus:outline-none focus:ring-2 focus:ring-purple-400"
          />
          <input
            type="text"
            name="qualification"
            placeholder="Qualification"
            required
            value={formData.qualification}
            onChange={handleChange}
            className="border p-3 rounded w-full focus:outline-none focus:ring-2 focus:ring-purple-400"
          />
          <textarea
            name="permanent_address"
            placeholder="Permanent Address"
            required
            value={formData.permanent_address}
            onChange={handleChange}
            className="border p-3 rounded w-full focus:outline-none focus:ring-2 focus:ring-purple-400"
          ></textarea>
          <label className="flex items-center space-x-2 text-sm text-gray-600">
            <input type="checkbox" onChange={handleChange} />
            <span>Current address same as permanent</span>
          </label>
          <textarea
            name="current_address"
            placeholder="Current Address"
            required
            value={formData.current_address}
            onChange={handleChange}
            className="border p-3 rounded w-full focus:outline-none focus:ring-2 focus:ring-purple-400"
          ></textarea>
          <button
            type="submit"
            disabled={loading}
            className="bg-gradient-to-r from-purple-500 to-blue-500 text-white py-3 rounded w-full font-semibold transition transform hover:scale-105 active:scale-95"
          >
            {loading ? "Submitting..." : "Submit Details"}
          </button>
        </form>

        {/* Modal */}
        {showModal && (
          <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50 transition-opacity">
            <div className="bg-white p-6 rounded-xl shadow-lg text-center animate-fade-in-up">
              <h2 className="text-xl font-semibold text-green-600 mb-2">
                ✅ Submitted!
              </h2>
              <p className="text-gray-600">Form submitted successfully.</p>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
